import logo from './logo.svg';
import './App.css';
import Axios from 'axios'
import React, { useState, useEffect } from 'react'
import Form from './components/Form'

//starting form values
const startFormValues = {
  //Text inputs//
  name: '',
  email: '',
  //Password//
  password: '',
  //Checkbox//
  terms: false,
}

const startMembers = []
const startDisabled = true

function App() {
  const [members, setMembers] = useState(startMembers)
  const [formValues, setFormValues] = useState(startFormValues)

  const [disabled, setDisabled] = useState(startDisabled)

  //Axios Stuff///
  const getMembers = () => {
    Axios.get('https://reqres.in/api/users')
      .then(res => {
        setMembers(res.data)
      })
      .catch(error => {
        console.log(error)
      })
  }
  const postNewMember = newMember => {
    Axios.post('https://reqres.in/api/users', newMember)
      .then(res => {
        setMembers([...members, res.data])
        setFormValues(startFormValues)
      })
      .catch(error => {
        setFormValues(startFormValues)
        console.log(error)
      })
  }

  return (
    <div className="App">
      <Form />
    </div>
  );
}

export default App;
